def solve():
    n = int(input())
    arr = list(map(int, input().split()))
    graph = defaultdict(list)
    in_degree = [0] * n
    for i in range(n):
        if arr[i] == 0:
            graph[i].append(-1)
        else:
            graph[arr[i] - 1].append(i)
            in_degree[i] += 1
    queue = []
    for i in range(n):
        if in_degree[i] == 0:
            queue.append(i)
    visited = set()
    while queue:
        node = queue.pop()
        visited.add(node)
        for child in graph[node]:
            in_degree[child] -= 1
            if in_degree[child] == 0:
                queue.append(child)
    if len(visited) == n:
