import sys

def solve():
    n = int(input())
    ans = []
    d = 2
    while n > 1:
        if n % d == 0:
            for i in range(1, n // d + 1):
                ans.append(i * d)
        else:
            ans.append(n)
        n = n // d
        d = 2
    for i in range(n - 1, 0, -1):
        ans.append(i)
    print(d)
    print(*ans)

